                height: 30px;
                margin-bottom: 20px;
                padding-left: 10px;
                border-radius: 4px;
                color: #58595f;
                outline: 0;
                border: solid 1px;
                transition: background-color 0.2s ease;
            }

            input[type=text] {
                width: 220px;
            }

            input:focus {
            border-color: red;
            }

        }
    `}</style>
        <section className="searchBox">
          <form action="" className="formContainer">
            <section className="title">
              <h2>Busca tu van r√°pido y facil</h2>
            </section>
            <section className="container-inputs">
              <input type="text" placeholder="Origen" />
